INSERT INTO `bibles` (`id`, `bible`, `ordering`, `created_at`, `updated_at`) VALUES
(1, '“Hãy để trẻ em đến với Thầy, đừng ngăn cấm chúng, vì Nước Thiên Chúa là của những ai giống như chúng.”\n– Marcô 10,14', 1, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(2, '“Ai đón nhận một em nhỏ như em này vì danh Thầy, là đón tiếp chính Thầy.”\n– Mátthêu 18,5', 2, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(3, '“Hỡi những người con, hãy vâng lời cha mẹ trong Chúa, vì điều đó là phải đạo.”\n– Êphêsô 6,1', 3, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(4, 'Chúa đã làm điều đó ngay hôm nay; Chúng ta hãy vui mừng và hân hoan ngày hôm nay (Thi Thiên 118:24).', 4, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(5, '“Ai sống thật thà, người ấy bước đi an toàn.”\n– Châm Ngôn 10,9', 5, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(6, '“Lời Chúa là ngọn đèn soi cho con bước, là ánh sáng chỉ đường con đi.”\n– Thánh Vịnh 119,105', 6, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(7, '“Các con hãy yêu thương nhau như Thầy đã yêu thương các con.”\n– Gioan 15,12', 7, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(8, '“Này đây, Thầy ở cùng anh em mọi ngày cho đến tận thế.”\n– Mátthêu 28,20', 8, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(9, '“Ai hạ mình xuống như em nhỏ này, người ấy là người lớn nhất trong Nước Trời.”\n– Mátthêu 18,4', 9, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(10, '“Hãy xin thì sẽ được, hãy tìm thì sẽ thấy, hãy gõ thì sẽ mở cho.”\n– Mátthêu 7,7', 10, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(11, '“Chúa là mục tử chăn dắt tôi, tôi chẳng thiếu thốn gì.”\n– Thánh Vịnh 23,1\n', 11, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(12, '“Khi tôi yếu, chính là lúc tôi mạnh.”\n– 2 Côrintô 12,10', 12, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(13, '“Đừng mỏi mệt khi làm việc thiện.”\n– Galát 6,9', 13, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(14, '“Trước khi tạo thành ngươi trong dạ mẹ, Ta đã biết ngươi.”\n– Giêrêmia 1,5', 14, '2025-04-29 10:28:07', '2025-07-29 10:30:15'),
(15, '“Hãy luôn vui mừng, cầu nguyện không ngừng, và tạ ơn trong mọi hoàn cảnh.”\n– 1 Thêsalônica 5,16-18', 15, '2025-04-29 10:28:07', '2025-07-29 10:30:15');
