INSERT INTO `courses` (`id`, `name`, `description`, `ordering`, `created_at`, `updated_at`) VALUES
(1, 'Khai Tâm 1', 'Lớp giáo lý dành cho các em mới bắt đầu tìm hiểu về Đức tin Công giáo, với nội dung giới thiệu về Thiên Chúa, Đức Mẹ Maria và các thánh.', 1, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(2, 'Khai Tâm 2', 'Tiếp nối từ Khai Tâm 1, giúp các em hiểu sâu hơn về các bí tích và những khía cạnh cơ bản của đời sống Kitô hữu.', 2, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(3, 'Khai Tâm 3', 'Giai đoạn cuối của Khai Tâm, tập trung vào việc giúp các em chuẩn bị sẵn sàng để đón nhận các bí tích, đặc biệt là bí tích Thánh Thể.', 3, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(4, 'Xưng Tội 1', 'Lớp giáo lý chuẩn bị cho các em lần đầu tiên lãnh nhận bí tích Giải Tội, giúp các em hiểu về sự sám hối và ơn tha thứ của Chúa.', 4, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(5, 'Xưng Tội 2', 'Tiếp tục rèn luyện việc thực hành bí tích Giải Tội, hướng dẫn các em sống đời sống Kitô hữu trong sự hòa giải và thánh thiện.', 5, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(6, 'Thêm Sức 1', 'Lớp giáo lý chuẩn bị cho các em lãnh nhận bí tích Thêm Sức, giúp các em hiểu về vai trò của Chúa Thánh Thần trong đời sống của mình.', 6, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(8, 'Thêm Sức 2A', 'Lớp giáo lý nâng cao dành cho những em đã hoàn thành Thêm Sức 2, tập trung vào việc sống đời Kitô hữu trưởng thành.', 7, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(9, 'Thêm Sức 2B', 'Lớp giáo lý tương tự Thêm Sức 2A nhưng nhấn mạnh vào việc phục vụ cộng đồng và đời sống thánh thiện trong gia đình.', 8, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(10, 'Thêm Sức 3A', 'Tiếp tục phát triển từ Thêm Sức 2A, giúp các em củng cố đức tin và chuẩn bị cho các thách thức trong đời sống đạo.', 9, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(11, 'Thêm Sức 3B', 'Lớp giáo lý nâng cao dành cho những em mong muốn phục vụ trong vai trò lãnh đạo tại các cộng đoàn giáo xứ.', 10, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(12, 'Kinh Thánh 1', 'Lớp giáo lý giới thiệu về Kinh Thánh, giúp các em nắm vững các câu chuyện chính và ý nghĩa của Cựu Ước.', 11, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(13, 'Kinh Thánh 2', 'Tiếp nối Kinh Thánh 1, giúp các em hiểu sâu hơn về Tân Ước và vai trò của Chúa Giêsu trong lịch sử cứu độ.', 12, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(14, 'Bao Đồng 1', 'Lớp giáo lý chuẩn bị cho các em lãnh nhận nghi thức Bao Đồng, giúp các em tái khẳng định đức tin Kitô giáo trước cộng đoàn.', 13, '2025-04-29 10:28:07', '2025-07-29 10:30:09'),
(15, 'Bao Đồng 2', 'Tiếp tục từ Bao Đồng 1, giúp các em củng cố đức tin và chuẩn bị sẵn sàng để sống đời sống Kitô hữu trưởng thành.', 14, '2025-04-29 10:28:07', '2025-07-29 10:30:09');
