INSERT INTO `feedbacks` (`id`, `user_id`, `isHideUser`, `type`, `title`, `content`, `handled_by`, `status`, `resolved_at`, `note`, `created_at`, `updated_at`) VALUES
(1, 4, 0, 'feedback', 'Đổi màu ô “THÊM GÓP Ý” ', 'Đổi màu ô Thêm Góp Ý thành màu xanh lá, khác với những ô còn lại để dễ nhìn và giao diện đẹp hơn.', 2, 'resolved', '2025-05-23 02:08:02', 'Cảm ơn sự góp ý của bạn. Chúng mình đã thay đổi rồi', '2025-05-22 16:39:39', '2025-05-23 02:08:02'),
(2, 2, 0, 'feedback', 'Ẩn thuộc tính (Tiếp nhận)', 'Trong khi ở trạng thái đang xử lý thì cần ẩn đi nút Tiếp nhận cho hợp lý hơn', 2, 'resolved', '2025-05-23 02:08:21', 'Đã xử lý xong', '2025-05-22 16:47:08', '2025-05-23 02:08:21'),
(3, 2, 0, 'feedback', 'Điều chỉnh cải thiện', '1. Thêm 1 nút khi tiếp nhận của admin để có thể xứ lý luôn tại giao diện của Admin mà không phải chuyển cho 1 người khác\n2. Nên dùng modal để hiện ảnh hoặc cách khác ko nên dùng target để chuyển qua trang khác.\n3. Thay đổi chữ kéo thả hình vào đây ở feedback và complaint bằng kéo thả hình vào đây / chọn hình\n4. Thay đổi chữ tối đa 5 hình là tối đa 4 hình', 2, 'resolved', '2025-05-23 02:08:30', 'Đã xử lý xong', '2025-05-22 17:34:59', '2025-05-23 02:08:30');
