(1, 'Đoàn Thiếu Nhi Thánh Thể Giáo Xứ Mỹ Vân', 'tntt.myvan@gmail.com', '', 'Website Đoàn Thiếu Nhi Thánh Thể Giáo Xứ Mỹ Vân để kết nối giữa Huynh Trưởng với phụ huỳnh và các em Thiếu Nhi trong giáo xứ.', 'Đoàn Thiếu Nhi Thánh Thể Giáo xứ Mỹ Vân là tổ chức giáo dục đức tin và nhân bản dành cho các em thiếu nhi trong giáo xứ. Với mục tiêu “Yêu mến Chúa Giêsu Thánh Thể – Phục vụ thiếu nhi – Làm chứng cho Tin Mừng”, Đoàn luôn là nơi ươm mầm đức tin cho thế hệ trẻ tại Mỹ Vân.', 'https://www.facebook.com/profile.php?id=100069752143507', NULL, 'https://www.youtube.com/@TNTTGiaoXuMyVan', 'https://www.tiktok.com/@xudoangiusevien', 'LOGO_default.png', 'FAVICON_default.png', '2025-04-29 10:28:07', '2025-05-24 10:06:36');
