INSERT INTO `roles` (`id`, `name`, `ordering`, `description`, `type`, `created_at`, `updated_at`) VALUES
(1, 'Admin', 1, 'Quản trị toàn bộ hệ thống và sửa chữa hệ thống theo nhu cầu của đoàn.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(2, 'Cha Tuyên Úy', 2, 'Người đứng đầu xứ đoàn, chịu trách nhiệm quản lý và điều hành hoạt động của xứ đoàn.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(3, 'Xứ Đoàn Trưởng', 3, 'Đứng đầu xứ đoàn, chịu trách nhiệm quản lý và điều hành hoạt động của xứ đoàn.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(4, 'Xứ Đoàn Phó', 4, 'Hỗ trợ xứ Đoàn trưởng trong việc điều hành và quản lý các hoạt động của xứ đoàn.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(5, 'Trưởng Ngành Nghĩa', 5, 'Đứng đầu và điều hành ngành nghĩa trong xứ đoàn.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(6, 'Phó Ngành Nghĩa', 6, 'Hỗ trợ trưởng ngành nghĩa trong việc quản lý và điều hành ngành.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(7, 'Trưởng Ngành Thiếu', 7, 'Đứng đầu và điều hành ngành thiếu trong xứ đoàn.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(8, 'Phó Ngành Thiếu', 8, 'Hỗ trợ trưởng ngành thiếu trong việc quản lý và điều hành ngành.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(9, 'Trưởng Ngành Ấu', 9, 'Đứng đầu và điều hành ngành Ấu trong xứ đoàn.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(10, 'Phó Ngành Ấu', 10, 'Hỗ trợ trưởng ngành Ấu trong việc quản lý và điều hành ngành.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(11, 'Trưởng Ngành Tiền Ấu', 11, 'Đứng đầu và điều hành ngành tiền Ấu trong xứ đoàn.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(12, 'Phó Ngành Tiền Ấu', 12, 'Hỗ trợ trưởng ngành tiền Ấu trong việc quản lý và điều hành ngành.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(13, 'Huynh Trưởng', 13, 'Hướng dẫn và quản lý các thành viên trong ngành, đồng hành cùng thiếu nhi trong việc phát triển.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(14, 'Dự Trưởng', 14, 'Hỗ trợ huynh trưởng trong việc quản lý các thành viên, thường là huynh trưởng dự bị.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(15, 'Đội Trưởng', 15, 'Quản lý và dẫn dắt một đội nhỏ trong ngành, đảm bảo các hoạt động được thực hiện đúng kế hoạch.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34'),
(16, 'Thiếu Nhi', 16, 'Thành viên nhỏ tuổi của xứ đoàn, tham gia các hoạt động giáo dục và sinh hoạt.', 'System', '2025-04-29 10:28:07', '2025-06-23 09:57:34');
